import React from 'react'

function Cart({initialItems}) {
    return(
        <div>
            <h1>I am Cart</h1>

            {initialItems.map(item => (
                <li>
                    Name: {item.name}
                </li>
            ))}


        </div>
    )
}

export default Cart;
